// import axios from "axios";
// import { useEffect, useState } from "react";
import { Route, Routes } from "react-router-dom";
import RegistrationPage from "./pages/RegistrationPage";

function App() {
	return (
		<div>
			<div className="mx-20">
				<Routes>
					<Route path="/register" element={<RegistrationPage />} />
				</Routes>
			</div>
		</div>
	);

	const [users, setUsers] = useState([]);

	const fetchData = async () => {
		const response = await axios.get("http://127.0.0.1:8000/api/users");

		setUsers(response.data["users"]);
	};

	useEffect(() => {
		fetchData();
	}, []);

	const renderedUsers = users.map((user, index) => {
		return (
			<div
				className="flex justify-center bg-red-100 py-2 my-1"
				key={index}
			>
				<p>{user.name}</p>
			</div>
		);
	});
	return (
		<div className="App grid justify-center">
			<h1 className="text-center text-3xl font-semibold py-3">
				React and Laravel Connection
			</h1>
			<div className="flex justify-center gap-5 py-2">
				<button className="py-2 px-4 border border-gray-500 rounded-lg">
					Simple Button
				</button>
				<button className="py-2 px-4 border border-gray-700 rounded-full bg-blue-700 text-white">
					Other Button
				</button>
			</div>

			<h2 className="text-center text-2xl font-semibold py-3 my-3">
				User List
			</h2>
			{"" || renderedUsers}
		</div>
	);
}

export default App;
